import React, {useEffect, useState} from "react";
import Navbar from "../components/Navbar";
import styled from "styled-components";
import {FaInstagram} from "react-icons/fa";
import {Link} from "react-router-dom";
import axios from "axios";

const Container = styled.div`
    display: flex;
    align-items: center;
`;




const About = () => {
    const apiUrl = 'https://18.219.147.241';
    const [about, setAbout] = useState([]);
    useEffect(() => {
        const getAbout = async() => {
            try {
                console.log("get about")
                const response = await axios.get(`${apiUrl}/api/post/getAbout`);

                console.log(response.data);
                setAbout(response.data);
            } catch (error) {
                console.log(error, "This failed");
            }
        }
        getAbout();
    }, []);

    let index = about.length -1;
    return (
        <div>
            <Navbar/>
            <Container>
                <Wrapper>
                    {about.length === 0 ? (
                    <MainWrapper>
                    <Body>{"Loading..."}</Body>
                    <Image src={"Loading"}/>
                    <Body>{"Loading..."}</Body>
                            </MainWrapper>) : (
                                <MainWrapper>
                    <Body>{about[index].intro}</Body>
                    <Image src={about[index].photoUrl}/>
                    <Body>{about[index].body}</Body>
                                </MainWrapper>
                )}
                    <SubWrapper>
                        <Subtitle>Get in Touch</Subtitle>
                        <InfoWrapper>
                            <Info>Bessey Room 300</Info>
                            <InstagramLink to="https://www.instagram.com/cultr_magazine/">
                                <FaInstagram/>
                            </InstagramLink>
                        </InfoWrapper>
                    </SubWrapper>
                </Wrapper>
            </Container>
        </div>
    );
}

export default About;
